import React from 'react';

class ForgotPassword extends React.Component {
    constructor() {
        super();

        this.state = {
            email: '',
            password: ''
        };

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    render() {
        return (
            <div>
                ForgotPassword
            </div>
        );
    }
}

export default ForgotPassword;
